import React, { useEffect, useState } from "react";
import api from "../../axiosConfig";
import "./UserDashboard.css";
import "./ViewStatus";
import "./SubmittedFeedbacks";
import { useNavigate } from "react-router-dom";
import { FaTrash } from "react-icons/fa";

const UserDashboard = () => {
  const navigate = useNavigate();
  const [username, setUsername] = useState("");
  const [feedbacks, setFeedbacks] = useState([]);
  const [view, setView] = useState("submitted"); // default view

  useEffect(() => {
    const token = localStorage.getItem("token");
    if (!token) {
      navigate("/Login");
      return;
    }

    const payload = JSON.parse(atob(token.split(".")[1]));
    setUsername(payload["http://schemas.microsoft.com/ws/2008/06/identity/claims/name"]);

    fetchFeedbacks();
  }, []);

  const fetchFeedbacks = async () => {
    try {
      const res = await api.get("Feedback/my-feedbacks");
      setFeedbacks(res.data);
    } catch (err) {
      console.error(err);
    }
  };

  const handleLogout = () => {
    localStorage.removeItem("token");
    navigate("/UserLogin");
  };
  const handleDelete = async (id) => {
  if (!window.confirm("Are you sure you want to delete this feedback?")) return;

  try {
    await api.delete(`Feedback/delete/${id}`);
    // Refresh list
    setFeedbacks(feedbacks.filter(f => f.id !== id));
    alert("Feedback deleted successfully!");
  } catch (err) {
    console.error(err);
    alert("Failed to delete feedback.");
  }
};
const user=localStorage.getItem("userName")

  return (
    <div className="dashboard-container">
      {/* Top nav/header */}
      <header className="dashboard-header">
        <h2>Welcome, {user}?{user}:</h2>
        <nav>
          {/* Navigate to SubmitFeedback page */}
          <button onClick={() => navigate("/SubmitFeedback")}>Submit New Feedback</button>
          <button onClick={() => navigate("/ViewStatus")}>View Status</button>
          <button onClick={() => navigate("/SubmittedFeedbacks")}>Submitted Feedbacks</button>
        </nav>
        <button onClick={handleLogout} className="logout-btn">Logout</button>
      </header>

      {/* Middle content */}
      <main className="dashboard-content">
        {view === "recent" && (
          <div>
            <h3>Recent Feedback Status</h3>
            <table>
              <thead>
                <tr>
                  <th>Mentor</th>
                  <th>Week</th>
                  <th>Submitted On</th>
                  <th>Status</th>
                </tr>
              </thead>
              <tbody>
                {feedbacks.slice(-5).reverse().map(f => (
                  <tr key={f.id}>
                    <td>{f.mentorName}</td>
                    <td>{f.week}</td>
                    <td>{f.submittedOn ? new Date(f.submittedOn).toLocaleDateString() : "N/A"}</td>
                    <td>{f.status}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        )}

        {view === "submitted" && (
          <div>
            <h3>All Submitted Feedbacks</h3>
            <table>
              <thead>
                <tr>
                  <th>Mentor</th>
                  <th>Week</th>
                  <th>Submitted On</th>
                  <th>Status</th>
                  <th>Delete</th>
                </tr>
              </thead>
              <tbody>
                {feedbacks.length > 0 ? feedbacks.map(f => (
                  <tr key={f.id}>
                    <td>{f.mentorName}</td>
                    <td>{f.week}</td>
                    <td>{f.submittedOn ? new Date(f.submittedOn).toLocaleDateString() : "N/A"}</td>
                    <td>{f.status}</td>
                    <td >
                    <button 
                     className="Trash" onClick={() => handleDelete(f.id)}><FaTrash/></button>
                    </td>
                  </tr>
                )) : (
                  <tr>
                    <td colSpan="4">No feedbacks submitted yet.</td>
                  </tr>
                )}
              </tbody>
            </table>
          </div>
        )}
      </main>
    </div>
  );
};

export default UserDashboard;
